import styled from 'styled-components';

export const Title=styled.div`
  flex-basis: 3%;
  font-family: BerkeleyStd;
  font-size: 24px;
  font-weight: 500;
  line-height: 1.25;
  letter-spacing: 0.5px;
  color: #022737;
`;

export const Content=styled.div`
  flex-basis: 65%;
  font-family: HelveticaNeue;
  font-size: 16px;
  line-height: 1.5;
  color: #505050;
`;

export const Feature=styled.div`
    display: flex;
    padding: 30px;
`;
